import React from 'react';
import ReactDOM from 'react-dom';
import App from './scripts/App.js';
import {BrowserRouter} from 'react-router-dom';

ReactDOM.render(
	<BrowserRouter>
		<App />
	</BrowserRouter>,
	document.getElementById('container')
);
